; Lines beginning with ; are comments ...
; Empty lines are ignored

; This file contains information used to mirror a subfile across an
; arbitrary axis.  It specifies how to mirror part B and make it look
; like part A.  Then a program can mirror the already mirrored part B
; across an arbitrary axis and end up with an UN-mirrored part B in the
; right place and orientation to look like part A mirrored across the
; arbitrary axis.
; 
; Many parts are symmetric across the Z axis so a default mirror
; operation using the transform (-1 0 0 0 1 0 0 0 1) mirrors acros this
; axis.  Such parts need not appear in this file.  Other parts need
; additional rotation, translation, and possibly substitution.  This
; file tells what to do for those exceptional parts.
;
; Each line has the following format:
; PARTNAME MIRRORPART <Flags> <Matrix> <Offset>
; <PARTNAME> The name of the part file
; <MIRRORPART> The file name of the substutute part.
;              (It's the same as PARTNAME if no substitution is required.
; <Flags> always 0 reserved for future use
; <Matrix> a rotation matrix a11 a12 a13 ... a33 for optimal appearance at
;          0 degree rotation angle
; <Offset> The offset of the part to be in place
;
; NOTE: I started using the Flags to keep track of which parts I checked.
;          0 = not checked.  
;          1 = substitute part
;          2 = mirror across XY plane instead of default of ZY plane
;          3 = mirror and rotate a bit.
;          4 = mirror across XZ plane.  (common for studless technic liftarms)
;          5 = checked
;          6 = asymmetric
;          7 = asymmetric, but in a non-significant way

